INSERT INTO `site_stackoverflow_answers` (`answer_id`, `question_id`, `answer_description`, `answer_url_user`, `status`, `sequence`, `created_user_id`, `updated_user_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 2, '<p>Props is also an object and you can access the object key using string, for example</p>\n<pre class=\"lang-js prettyprint-override\"><code>const obj = { name: \'Gwen\' };\n\nconsole.log(obj[\'name\']);\n</code></pre>\n<p>Based on that, you can do the exact way to access your props name</p>\n<pre class=\"lang-js prettyprint-override\"><code>const handleStyle = (numberTxt) =&gt; {\n  if (!props[`hoverTxt${numberTxt}`]) {\n    return { display: &quot;none&quot; };\n  } else {\n    return {};\n  }\n};    \n\nreturn (\n  &lt;div&gt;\n    &lt;HeroAsideItems txt={props.hoverTxt5} style={handleStyle(5)} /&gt;\n  &lt;/div&gt;\n);\n</code></pre>\n    </div>', NULL, NULL, NULL, 1, 1, NULL, '2021-03-12 00:29:24', '2021-03-12 00:29:24'),
(2, 3, '<p>As you have mentioned that the data is string.\nSo first convert your string data to array using</p>\n<pre><code>var myArray = JSON.parse(your data);\n</code></pre>\n<p>Now filter you array with data you required to write on text file.</p>\n<pre><code>var filteredArray = myArray.filter(filArray =&gt; filArray.num = X);\n\n</code></pre>\n<p>Now write it on text file</p>\n<pre><code>var fs = require(\'fs\');\n\nvar file = fs.createWriteStream(\'array.txt\');\nfile.on(\'error\', function(err) {\n /* error handling */ \n});\nmyArray.forEach(function(v) { \n   file.write(v.join(\', \') + \'\\n\'); \n});\n\nfile.end();\n</code></pre>\n    </div>', NULL, NULL, NULL, 1, 1, NULL, '2021-03-12 00:29:26', '2021-03-12 00:29:26'),
(3, 2, '<p>Props is also an object and you can access the object key using string, for example</p>\n<pre class=\"lang-js prettyprint-override\"><code>const obj = { name: \'Gwen\' };\n\nconsole.log(obj[\'name\']);\n</code></pre>\n<p>Based on that, you can do the exact way to access your props name</p>\n<pre class=\"lang-js prettyprint-override\"><code>const handleStyle = (numberTxt) =&gt; {\n  if (!props[`hoverTxt${numberTxt}`]) {\n    return { display: &quot;none&quot; };\n  } else {\n    return {};\n  }\n};    \n\nreturn (\n  &lt;div&gt;\n    &lt;HeroAsideItems txt={props.hoverTxt5} style={handleStyle(5)} /&gt;\n  &lt;/div&gt;\n);\n</code></pre>\n    </div>', NULL, NULL, NULL, 1, 1, NULL, '2021-03-12 00:32:08', '2021-03-12 00:32:08'),
(4, 3, '<p>As you have mentioned that the data is string.\nSo first convert your string data to array using</p>\n<pre><code>var myArray = JSON.parse(your data);\n</code></pre>\n<p>Now filter you array with data you required to write on text file.</p>\n<pre><code>var filteredArray = myArray.filter(filArray =&gt; filArray.num = X);\n\n</code></pre>\n<p>Now write it on text file</p>\n<pre><code>var fs = require(\'fs\');\n\nvar file = fs.createWriteStream(\'array.txt\');\nfile.on(\'error\', function(err) {\n /* error handling */ \n});\nmyArray.forEach(function(v) { \n   file.write(v.join(\', \') + \'\\n\'); \n});\n\nfile.end();\n</code></pre>\n    </div>', NULL, NULL, NULL, 1, 1, NULL, '2021-03-12 00:32:11', '2021-03-12 00:32:11'),
(5, 8, '<p>You can do it with a <em>custom browser</em> running on mobile. Tampermonkey is probably the most common tool for running client-written JS on others\' pages (which some might find easier to use than writing multiple full-fledged extensions themselves). Tampermonkey also exists as a mobile browser for Android, though its usability is debatable:</p>\n<p><a href=\"https://play.google.com/store/apps/details?id=net.biniok.tampermonkey&amp;hl=en&amp;gl=US\" rel=\"nofollow noreferrer\">https://play.google.com/store/apps/details?id=net.biniok.tampermonkey&amp;hl=en&amp;gl=US</a></p>\n<p><a href=\"https://play.google.com/store/apps/details?id=net.tampermonkey.dolphin\" rel=\"nofollow noreferrer\">https://play.google.com/store/apps/details?id=net.tampermonkey.dolphin</a></p>\n<p>You basically just type in or paste the JS you want to run, and it\'ll run automatically when you visit a page matching the URL. If you want to go this route, you\'ll probably find Android Debug Bridge extremely helpful in working out the kinks.</p>\n    </div>', NULL, NULL, NULL, 1, 1, NULL, '2021-03-12 00:32:19', '2021-03-12 00:32:19');
INSERT INTO `site_stackoverflow_questions` (`question_id`, `question_name`, `question_url`, `question_description`, `question_url_user`, `status`, `sequence`, `created_user_id`, `updated_user_id`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Unable to read CefSharp Chromium console message', '/questions/66593947/unable-to-read-cefsharp-chromium-console-message', '\r\n                \r\n<p>I have a WinForm application that using cefsharp web browser. From what I learnt about cefsharp, the events <code>MouseDown</code>, <code>Click</code> cannot trigger in WinForm. So I decided to use javascript to send a message to the console, and trigger <code>ChromiumWebBrowser.ConsoleMessage</code> event instead. But that did not work well. Did I mess up the javascript code or execute the code wrongly?</p>\n<p>Here are the codes, please noted that <code>UI.cs</code> is a Form object. A panel object <code>pn_Browser</code> already created in the design view. What I tried to do is, click any element and send &quot;success&quot; to the console. Then the <code>Background</code> show the received message if the message in console.log is &quot;success&quot;.</p>\n<p><strong>Background.cs</strong></p>\n<pre><code>public ChromiumWebBrowser browser;\npublic Background() \n{\n    browser = new ChromiumWebBrowser(&quot;https://www.google.com&quot;);\n    browser.ConsoleMessage += browser_ConsoleMessage;\n}\n\npublic browser_ConsoleMessage(object sender, ConsoleMessageEventArgs e) \n{\n    if (e.Message == &quot;success&quot;) \n    {\n        System.Windows.Forms.MessageBox.Show(&quot;Received message.&quot;);\n    }\n}\n</code></pre>\n<p><strong>UI.cs</strong></p>\n<pre><code>public UI() \n{\n    InitializeComponent();\n    Background background = new Background();\n    pn_Browser.Controls.Add(background.browser);\n    background.browser.ExecuteScriptAsyncWhenPageLoaded(\n        &quot;document.addEventListener(\\&quot;click\\&quot;, test);&quot; + \n        &quot;function test() {console.log(\\&quot;success\\&quot;)}&quot;\n    );\n}\n</code></pre>\n    </div>\r\n\r\n        ', NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-12 00:29:22'),
(2, 'How to dynamically set prop names using react functional components', '/questions/66593930/how-to-dynamically-set-prop-names-using-react-functional-components', '\r\n                \r\n<pre><code>const handleStyle = () =&gt; {\n           if (!props.hoverTxt) {\n              return { display: &quot;none&quot; };\n            } else {\n              return {};\n            }\n          };    \n          return (\n            &lt;div&gt;\n              &lt;HeroAsideItems txt={props.hoverTxt} style={handleStyle()} /&gt;\n            &lt;/div&gt;\n          );\n        }\n        \n        export default HeroAsideCircles;\n</code></pre>\n<p>This is the code I have. below is the pseudocode I wish would work. In short I\'d like to dynamically set a prop name so i can have hoverTxt set the function parameters so if i pass 1 to the handleStyles function it will return props.hovertxt1 or if I set parameter as 6 </p>\n<pre><code>    const handleStyle = (tEXTnUMBER) =&gt; {\n    if (!props.hoverTxt + tEXTnUMBER) {\n      return { display: &quot;none&quot; };\n    } else {\n      return {};\n    }\n  };\n\n\n\n  return (\n    &lt;div&gt;\n      &lt;HeroAsideItems txt={props.hoverTxt5} style={handleStyle(5)} /&gt;\n    &lt;/div&gt;\n  );\n}\n\nexport default HeroAsideCircles;\n</code></pre>\n    </div>\r\n\r\n        ', NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-12 00:29:24'),
(3, 'Node.js Write Stream', '/questions/66593926/node-js-write-stream', '\r\n                \r\n<p>I have to write a Javascript program in which GET request is performed on a route that has data as key and value as string that has items in form, key=STRING,num=Integer. I have to count items having num equal to say X value and then write stream to a file with name &quot;op.txt&quot; the content of file has to be json key values on seperate lines in order they appear in JSON file, file should end with a new line character on its own line and output has to be SHA1 hash of file</p>\n<p>I used following code</p>\n<pre><code>const https = require(\'https\');\nhttps.get(\'https://xyz/api/JSON/num-check\', (resp) =&gt; {\n  let data = \'\';\n  var fs = require(\'fs\');\n  var stream;\n  stream = fs.createWriterStream(\'op.txt\');\n  \n  for( var i in data) {\n    stream.write(i);\n  }  \n});\n</code></pre>\n    </div>\r\n\r\n        ', NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-12 00:29:26'),
(4, 'Why is my .load() jquery is not updating its div content in flask?', '/questions/66593905/why-is-my-load-jquery-is-not-updating-its-div-content-in-flask', NULL, NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-11 20:53:02'),
(5, 'How to update the &#39;Context Menu&#39; before right click using Javascript', '/questions/66593902/how-to-update-the-context-menu-before-right-click-using-javascript', '\r\n                \r\n<p>I have written a Web Extension for my organisation that works with firefox and chrome. It allows the user to quickly navigate to webpages that my organization uses frequently using keyboard shortcuts and right clicks. You can think of it a bit like bookmarks but it automatically adds parameters to the URL based on the current website. This saves a little time, many times a day.</p>\n<p>I would love to be able to update my context menu to only show relevant items. I can determine what items are relevant based on the current tabs URL.</p>\n<p>Is there any way to update the context menu just before the users sees it?\ne.g. A \'<em>before right click</em>\' event or \'<em>before context menu load</em>\'</p>\n<p>At the moment I have tried using a combination of</p>\n<pre><code>// When a user selects a new tab\nchrome.tabs.onActivated.addListener(updateMyContextMenuCallback );\n</code></pre>\n<p>and</p>\n<pre><code>// When an existing tabs URL changes\nchrome.tabs.onUpdated.addListener((tabId, changeInfo, tabInfo) =&gt; { updateMyContextMenuCallback })\n</code></pre>\n<p>However, these methods come with some problems. For example, when a new tab is opened in the background \'chrome.tabs.onUpdated\' fires and the context menu becomes based on that instead of the currently active tab.</p>\n<p>I have done a lot of reading and testing but I havent found a good solution. Thanks for any help.</p>\n    </div>\r\n\r\n        ', NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-12 00:32:13'),
(6, 'Can I capture and edit audio stream locally before it hits another app?', '/questions/66593899/can-i-capture-and-edit-audio-stream-locally-before-it-hits-another-app', '\r\n                \r\n<p>Good afternoon!  In this implementation I\'m using electron and javascript with webRTC.</p>\n<p>To elaborate a bit on the question, I understand what I\'m doing up to the point of obtaining a stream from the StreamHandler and calling mediaDevices.getUserMedia.  Once I have that stream I have successfully added AudioContext to create filters, adjust gain, etc.  I\'ve heard these changes taking place on the audioDestination device as well.  So all is good up to that point.  So my question now is how do I then place that edited audio stream back on it\'s way to wherever it might go?  A specific example would be, let\'s say I captured the stream of my main microphone and I want to adjust the gain before, say, the audio makes it to discord, twitch, etc.</p>\n<p>If I\'m visualizing the process I think</p>\n<p>Mic Input ---&gt;  Grab Stream  ---&gt; Edit Stream ---&gt; Continue output to 3rd party app.</p>\n<p>But what seems to happen is the stream creates a separate channel and will only play on my own output devices as there is no destination for me to choose from devices that points to where my audio was already heading.  Please understand I am still figuring out how all of this works.  I\'m also happy to change or edit the question to better meet the standards, just let me know.</p>\n    </div>\r\n\r\n        ', NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-12 00:32:15'),
(7, 'Uncaught TypeError: Cannot set property &#39;_DT_CellIndex&#39; of undefined Laravue', '/questions/66593898/uncaught-typeerror-cannot-set-property-dt-cellindex-of-undefined-laravue', '\r\n                \r\n<p>I know this is common question but I can\'t find a way on how to solve this problem. I keep searching and the most common problem is the <code>th</code> and <code>td</code> table are not matched. Im been using laravue, what should I do to figure the problem?</p>\n<blockquote>\n<p>This thing works properly but the problem is when I remove at least one column both <code>th</code> and <code>td</code> the error will pops in console <code>DT_CellIndex undefined</code>. It would be great if anybody could figure out, thank you so much in advance!.</p>\n</blockquote>\n<blockquote>\n<p>Complete column it works fine like this</p>\n</blockquote>\n<p><a href=\"https://i.stack.imgur.com/2P5S8.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/2P5S8.png\" alt=\"enter image description here\" /></a></p>\n<blockquote>\n<p>But when I remove at least one column it the error pops</p>\n</blockquote>\n<p><a href=\"https://i.stack.imgur.com/lXqbR.png\" rel=\"nofollow noreferrer\"><img src=\"https://i.stack.imgur.com/lXqbR.png\" alt=\"enter image description here\" /></a></p>\n<pre><code>        &lt;table class=&quot;table table-separate table-head-custom table-checkable&quot; id=&quot;kt_datatable1&quot;&gt;\n        &lt;thead&gt;\n            &lt;tr&gt;\n                &lt;th&gt;Record ID&lt;/th&gt;\n                &lt;th&gt;Order ID&lt;/th&gt;\n                &lt;th&gt;Country&lt;/th&gt;\n                &lt;th&gt;Ship City&lt;/th&gt;\n                &lt;th&gt;Ship Address&lt;/th&gt;\n                &lt;th&gt;Company Agent&lt;/th&gt;\n                &lt;th&gt;Company Name&lt;/th&gt;\n                &lt;th&gt;Ship Date&lt;/th&gt;\n                &lt;th&gt;Status&lt;/th&gt;\n                &lt;th&gt;Type&lt;/th&gt;\n              \n            &lt;/tr&gt;\n          &lt;/thead&gt;\n         &lt;tbody&gt;\n            &lt;tr&gt;\n                &lt;td&gt;1&lt;/td&gt;\n                &lt;td&gt;64616-103&lt;/td&gt;\n                &lt;td&gt;Brazil&lt;/td&gt;\n                &lt;td&gt;São Félix do Xingu&lt;/td&gt;\n                &lt;td&gt;698 Oriole Pass&lt;/td&gt;\n                &lt;td&gt;Hayes Boule&lt;/td&gt;\n                &lt;td&gt;Casper-Kerluke&lt;/td&gt;\n                &lt;td&gt;10/15/2017&lt;/td&gt;\n                &lt;td&gt;5&lt;/td&gt;\n                &lt;td&gt;1&lt;/td&gt;\n            &lt;/tr&gt;\n        &lt;/tbody&gt;\n    &lt;/table&gt;\n</code></pre>\n    </div>\r\n\r\n        ', NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-12 00:32:16'),
(8, 'Is it possible to inject a content-script into a web page without a browser extension?', '/questions/66593882/is-it-possible-to-inject-a-content-script-into-a-web-page-without-a-browser-exte', '\r\n                \r\n<p>I know this is a shady question and I promise I don\'t have malicious intent - I am hoping to get an answer that provides security against using it to conduct fishing attacks on a vendor\'s domain.</p>\n<p>Currently I am accustomed to writing private Chrome extensions to &quot;fix up&quot; the limitations of websites I frequent (such as adding folders/category tags in my YouTube subscriptions) by injecting a JavaScript content script on certain domains.</p>\n<p>These enhancements are not available on mobile devices because you cannot use browser extensions. I would love to add my enhancements to my mobile browser but don\'t know how to inject my content script.</p>\n<p>I would imagine it\'s not possible to add JavaScript into a URL, so I can\'t add my content scripts to my bookmarks. e.g.</p>\n<pre><code>https://google.com;javascript:alert(42)\n</code></pre>\n<p>I was thinking I could set up an http proxy that lives on it own domain, such as:</p>\n<pre><code>https://youtube.enhanced.app\n</code></pre>\n<p>and this proxy intercepts the index.html and injects the enhanced content script (making it an installable web app and fixing up UI issues). But of course then I have to pay the bandwidth of the vendor page while also not benefiting from their caching and optimization.</p>\n<p>Are there any alternative ways for me to achieve this?</p>\n    </div>\r\n\r\n        ', NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-12 00:32:19'),
