(10, 'In Pug Interpolation, what&#39;s the real difference between using buffered code and using #{..}?', '/questions/66593804/in-pug-interpolation-whats-the-real-difference-between-using-buffered-code-and', '\r\n                \r\n<p>As stated in the <a href=\"https://pugjs.org/language/interpolation.html\" rel=\"nofollow noreferrer\">docs</a> for interpolation:</p>\n<pre><code>- var title = &quot;On Dogs: Man\'s Best Friend&quot;;\n- var author = &quot;enlore&quot;;\n- var theGreat = &quot;&lt;span&gt;escape!&lt;/span&gt;&quot;;\n\nh1= title\np Written with love by #{author}\np This will be safe: #{theGreat}\n</code></pre>\n<p><em>\'\'title follows the basic pattern for evaluating a template local, <strong>but</strong> the code in between #{ and } is evaluated, escaped, and the result buffered into the output of the template being rendered.</em></p>\n<p><em>This can be any valid Javascript expression, so you can do whatever feels good.\'\'</em></p>\n<p>However, the buffered code in  <code>h1= title </code> is still evaluated, escaped, buffered...,  and <em>supports the full range of JavaScript expressions</em> as stated <a href=\"https://pugjs.org/language/code.html\" rel=\"nofollow noreferrer\">here</a>.</p>\n<p>So what is the difference? I can\'t figure it out</p>\n    </div>\r\n\r\n        ', NULL, NULL, NULL, 1, 1, NULL, '2021-03-11 20:53:02', '2021-03-12 00:32:23'),
